    """Return list with elements incremented by 1.
    >>> incr_list([1, 2, 3])
    [2, 3, 4]
    >>> incr_list([5, 3, 5, 2, 3, 3, 9, 0, 123])
    [6, 4, 6, 3, 4, 4, 10, 1, 124]
    """
    if len(l) == 0:
        return []

    if len(l) == 1:
        return l + 1

    last_idx = len(l) - 1
    first_idx = 0
    for idx in range(len(l)):
        if l[idx - 1] < l[idx]:
            last_idx = idx
            first_idx = idx
        elif l[idx] < l[idx+1:]:
            last_idx = idx
            first_idx = idx + 1
        else:
            break

    return incr_list(l[:last_idx]) + incr_list(l[first_idx:])

